  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes breeding bird surveys
  that were conducted on Tewaukon National Wildlife Refuge in June and July of 2002.
  \ Eleven study plots were established and divided into three different categories:
  1) native prairie reference, 2) sites to be managed, and 3) potential Bird Conservation
  Area (BCA) sites.  Birds in these plots were counted using spot-mapping technique.
  \ The most common grassland species overall were Clay-colored Sparrow, Sedge Wren,
  Bobolink, and Savannah Sparrow.  Tables of species observed, population densities,
  and plot coordinates are provided at the end of the report.\",\n\t\"license_title\":
